
<canvas
    id='tire'


    width="1410"
    height="609"
    style='padding:10px;border: 1px solid red;
    width:456px; height: 224px;

'>

</canvas>

    <script>

        let tire_back = new Image();
        tire_back.src = "data:image/png;base64,";


            let tire_canvas = document.getElementById('tire');


            let tire_ctx = tire_canvas.getContext('2d');

        tire_ctx.font = '30px sans-serif';
        tire_ctx.drawImage( tire_back, 0 , 0 , 1410 , 603 );


        {{--<td>{{ }}</td>--}}
        {{--<td>FRONT<br>AVANT</td>--}}
        {{--<td>{{ $vehicle->cabSeatsUsed }}</td>--}}
        {{--<td>REAR<br>ARRI&Egrave;RE</td>--}}
        {{--<td>{{ $vehicle->passengerSeatsUsed }}</td>--}}


        tire_ctx.fillText("{{ $vehicle->passengerSeatsUsed + $vehicle->cabSeatsUsed  }}", 870, 135);
        tire_ctx.fillText("{{ $vehicle->cabSeatsUsed  }}", 1090, 135);
        tire_ctx.fillText("{{ $vehicle->passengerSeatsUsed  }}", 1350, 135);

        // max weight capacity
        tire_ctx.fillText("{{ round( $vehicle->payload * 0.453592 )  }}", 1075, 200);
        tire_ctx.fillStyle = "white";
        tire_ctx.fillRect(1325, 161, 60, 60 );
        tire_ctx.fillStyle = "black";


        tire_ctx.fillText("{{ $vehicle->payload  }}", 1265, 200);
        tire_ctx.font = '22px serif';

        tire_ctx.fillText("LB", 1352, 181);
        tire_ctx.fillText("LB", 1352, 205);



        tire_ctx.font = '22px sans-serif';

        tire_ctx.fillText("{{ $vehicle->tire_size  }}", 230, 340);
        tire_ctx.fillText("{{ $vehicle->tire_size  }}", 230, 420);
        tire_ctx.fillText("{{ $vehicle->tire_size  }}", 230, 490);

        tire_ctx.font = '30px sans-serif';
        tire_ctx.fillText("{{ round(6.89476 * $vehicle->front_tire_pressure / 10) * 10 }}", 460, 340);
        tire_ctx.fillText("{{ round(6.89476 * $vehicle->rear_tire_pressure / 10) * 10 }}", 460, 420);
        tire_ctx.fillText("{{ round(6.89476 * $vehicle->rear_tire_pressure / 10) * 10 }}", 460, 490);

        tire_ctx.fillText("{{ round ( $vehicle->front_tire_pressure  ) }}", 760, 340);
        tire_ctx.fillText("{{  round ( $vehicle->rear_tire_pressure ) }}", 760, 420);
        tire_ctx.fillText("{{  round ( $vehicle->spare_tire_pressure ) }}", 760, 490);


        tire_ctx.fillStyle = "white";
        tire_ctx.fillRect( 0, 522, 16, 531 )

        tire_ctx.fillRect( 1400, 522, 50, 200 )
        tire_ctx.fillStyle = "black";
        tire_ctx.fillRect( 4, 520, 1406, 2 )



</script>
